import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
    return (
        <div>
            <h1>HR Management System</h1>
            <nav>
                <Link to="/employees">Manage Employees</Link>
                <Link to="/vehicles">Manage Vehicles</Link>
            </nav>
        </div>
    );
};

export default Dashboard;
